package leetcode;

public class ImplementStr_28 {

	
	 public static int strStr(String haystack, String needle) {
		 
		  //base case
	        if(haystack.length()==0 && needle.length() ==0) return 0;
	        
	        if(needle.length() > haystack.length() ) return -1;
	        
	        if(haystack.length()==0) return -1;
	        
	        if(needle.length() ==0) return 0;
	        
	        if(needle.length() == haystack.length() && needle.charAt(needle.length()-1) != haystack.charAt(haystack.length()-1)) return -1;
	        //if(needle.length() == 0 && haystack.length() == 0 && needle.charAt(0) == haystack.charAt(0)) return 0;
	        if(needle.length() == haystack.length() && needle.charAt(0) == haystack.charAt(0)) return 0;
	        
	        
	        
	        
	        int index = 0;
	        for(int i = 0; i<haystack.length(); i++) {
	        	
	        	if(haystack.charAt(i) == needle.charAt(0)) {
	        		
	        	if(needle.length()== 1) return i;
	        		
	        		System.out.println("Good: "  + i + " I:" + i);
	        		index = i;
	        		int tempPointer = i+1;
	        		for(int x = 1; x<needle.length(); x++) {
	        			//System.out.println("i: " + x +" "+haystack.charAt(tempPointer) +" : "+ needle.charAt(x));
	        			if(tempPointer >= haystack.length()) break;
	        			if(x < haystack.length() && haystack.charAt(tempPointer) != needle.charAt(x)) {
	        			
	        			break;
	        			}
	        			
	        			
	        			
	        			//if(haystack.length() - tempPointer < needle.length()) break;
	        			
	        			System.out.println("good: "  + x + " I:" + tempPointer);
	        			if(x == needle.length()-1)
	        				return index;
	        			
	        			tempPointer++;
	        		}
	        	}
	        	
	        }	    
	        return -1;
	 }

	public static void main(String[] args) {
		
		String hay = "";
		String needle ="";
		
		//aaa
		//a
		
		//a
		//a
		
//		"babba"
//		"bbb"
		
//		hello - l = 5 - 3 = 2
//		liu - l = 3
		System.out.println(strStr(hay,needle));
	}
	
}


